import MoldePesquisa from '../../components/molde-barra-pesquisa';
import MoldeSide from '../../components/molde-sidebar/molde-sidebar';
import './style.css';



export default class Perfil extends Component {
    render() {
        return (
            <div>
                <MoldeSide />
                <MoldePesquisa />
                <div>
                    <h1>GRAFICO GERAL</h1>
                    <div>
                        <Line data={chartData} />
                    </div>
                </div>
            </div>
        )
    }
}
